static inline bool sym_identifier_character_set_3(int32_t lookahead) {
  return
    lookahead == 0 ||
    lookahead == '\t' ||
    lookahead == '\n' ||
    lookahead == '\r' ||
    (' ' <= lookahead && lookahead <= '"') ||
    lookahead == '$' ||
    lookahead == '%' ||
    ('\'' <= lookahead && lookahead <= '.') ||
    lookahead == ':' ||
    lookahead == '=' ||
    ('[' <= lookahead && lookahead <= ']') ||
    lookahead == '{' ||
    lookahead == '}';
}

